import React from 'react';
import { Link } from 'react-router-dom';
import '../style.css';

const ProjectBox = ({ title1, link1, title2, link2 }) => {
  return (
    <div>
      <div className="project-box">
        <Link to={link1}>
          <h3>{title1}</h3>
        </Link>
      </div>
      <div className="project-box">
        <Link to={link2}>
          <h3>{title2}</h3>
        </Link>
      </div>
    </div>
  );
};

export default ProjectBox;
